.switch {
  position: relative;
  display: inline-block;
  width: 3.2em;
  height: 1.5em;
  z-index: 1;
}

.switch input {
  opacity: 0;
  width: 0;
  height: 0;
}

.slider {
  position: absolute;
  cursor: pointer;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background-color: #ccc;
  -webkit-transition: .4s;
  transition: .4s;
}

.slider:before {
  position: absolute;
  content: "";
  height: 1.7em;
  width: 1.7em;
  left: 0;
  top: -2px;
  background-color: white;
  transition: .4s;
  box-shadow: #ccc 0px 5px 15px;
}

input:checked+.slider {
  background-color: #9747FF;
}

input:focus+.slider {
  box-shadow: 0 0 1px #9747FF;
}

input:checked+.slider:before {
  -webkit-transform: translateX(26px);
  -ms-transform: translateX(26px);
  transform: translateX(26px);
}

.slider.round {
  border-radius: 2em;
}

.slider.round:before {
  border-radius: 50%;
}

button {
  outline: none;
  background-color: transparent;
  border: 0 none;
  position: absolute;
  z-index: 2;
  width: 4em;
